('2371','15','7899','Finca Lafont',Null,'Haus im Fincastil mit Gästeapartment in Algaida','33373','Algaida liegt nur 15 Fahrminuten von Palma de Mallorca und 10 Min vom Golfplatz Son Gual entfernt. Das Haus steht auf einem ca 15.000m² großen, flachen Grundstück. Die 330m² Wohnfläche verteilt sich auf 2 Wohnetagen plus separates Gästeapartment. Im Haupthaus hat es ein Wohn-Esszimmer, Küche, 3 Schlafzimmer, 2 Badezimmer und Hauswirtschaftsraum. Das 45m² große Gästeapartment bietet ein Wohn-Schlafzimmer mit Küche, Schlafzimmer und Badezimmer. Zur Ausstattung gehören u.a. eine Ölzentralheizung, Teakholzfenster mit Doppelverglasung, städtischer Anschluss an Wasser und Strom, Wasserreservoir mit 70.000l u.v.m. Im Außenbereich befinden sich noch ein Pool und ein überdachter Barbecue. Eine ca 55m² große Garage bietet Platz für 2 Autos','33374','875000','106','2015-09-09 10:38:22','106','2015-09-09 10:39:00',Null,'2461','131','1155',1,'1','0',Null,Null,Null,'33375',Null,'0','0','0',Null,'2015-09-09 10:47:39',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33376',Null,'33377',Null,'33378',Null,'33379','670780722','33380','0',0,'4');
